INSERT INTO `actors` VALUES (11,'Trấn thành','1987-02-05','Trấn Thành tên khai sinh Huỳnh Trấn Thành (sinh ngày 5 tháng 2 năm 1987) là một diễn viên hài, người dẫn chương trình, diễn viên lồng tiếng và diễn viên điện ảnh người Việt Nam.\r\n\r\n','Male','public\\uploads\\1739931530533_tran-thanh-doc.jpg','2025-02-19 02:18:50','2025-02-19 02:18:50',NULL),(12,'Trần Tiểu vi','2000-08-23','updating','Female','public\\uploads\\1739931606479_tiá»u vi.jpg','2025-02-19 02:20:06','2025-02-19 02:20:06',NULL),(13,'Hạnh thuý','1989-02-02','Updating','Female','public\\uploads\\1739931711137_ht-1_1643760856277.jpeg','2025-02-19 02:21:51','2025-02-19 02:21:51',NULL),(14,'NSUT Chiều Xuân','1967-02-13','updating','Female','public\\uploads\\1739931829557_nsut-chieu-xuan-500_1699417275440.jpg','2025-02-19 02:23:49','2025-02-19 02:23:49',NULL),(15,'Huỳnh Lập','1993-05-17','Huỳnh Ngọc Lập (sinh ngày 17 tháng 5 năm 1993), thường được biết đến với nghệ danh Huỳnh Lập, là một nam diễn viên, nghệ sĩ hài, doanh nhân kiêm nhà làm phim người Việt Nam.\r\n\r\nKhởi nghiệp vào năm 2012 dưới tư cách là người sáng lập và thành viên của nhóm hài DAMTV, anh được công chúng biết đến sau khi đoạt giải quán quân cuộc thi Cười xuyên Việt vào năm 2015','Male','public\\uploads\\1739946378002_Huynh_Lap_(2018).png','2025-02-19 06:26:18','2025-02-19 06:26:18',NULL),(16,'Diễm Trang','2002-02-02','updating..','Female','public\\uploads\\1739946463804_004-diemtrang2-324.jpg','2025-02-19 06:27:43','2025-02-19 06:27:43',NULL),(17,'NSUT Quang Tèo','1962-04-24','Nguyễn Tiến Quang (sinh năm 1962), thường được biết đến với nghệ danh Quang Tèo, là một nam diễn viên Việt Nam. Ông là một quân nhân chuyên nghiệp tốt nghiệp trường Cao đẳng Văn hóa - Nghệ thuật Quân đội, mang quân hàm Thượng tá. Mặc dù công tác trong quân ngũ nhưng lĩnh vực mà Quang Tèo nổi tiếng nhất là hài kịch. Trong hài kịch, ông cùng với nghệ sĩ Lê Hồng Giang tạo thành một cặp đôi Quang Tèo - Giang Còi của làng hài Việt từ những năm đầu của thập niên 2000 cho đến khi Giang Còi qua đời vào năm 2021.','Male','public\\uploads\\1739946560080_Z2880158896880_7479b5cd49f6fad1da95aad5953b4399.jpg','2025-02-19 06:29:20','2025-02-19 06:29:20',NULL),(18,'Anthony Mackie ','1978-09-23','updating..','Male','public\\uploads\\1739947733794_anthony-mackie.jpg','2025-02-19 06:48:53','2025-02-19 06:48:53',NULL),(19,'Ben Whishaw  ','1980-01-14','updating..','Male','public\\uploads\\1739949980980_ben-doc.jpg','2025-02-19 07:26:20','2025-02-19 07:26:20',NULL),(20,'Emily Mortimer  ','1997-08-08','updating','Female','public\\uploads\\1739950081438_rrr-1_1654590214047.jpg','2025-02-19 07:28:01','2025-02-19 07:28:01',NULL),(21,'Phương Mỹ Chi','2003-01-13','Phương Mỹ Chi (sinh ngày 13 tháng 1 năm 2003) là một nữ ca sĩ kiêm sáng tác nhạc người Việt Nam.[1][2] Khởi nghiệp từ năm 2013, cô bắt đầu nổi danh từ khi tham gia và đạt giải Á quân của mùa đầu tiên trong chương trình Giọng hát Việt nhí.[3]\r\n\r\nSau khi thành công với các bài hát dân ca Nam Bộ Việt Nam, album phòng thu thứ tư cũng như là album nhạc pop đầu tiên trong sự nghiệp của cô, Vũ trụ cò bay (2023), bao gồm các bài hát do chính cô sáng tác, đã đạt được thành công lớn về mặt thương mại, được công chúng và các nhà phê bình âm nhạc đánh giá cao.','Male','https://res.cloudinary.com/dulanzv46/image/upload/v1744388731/actors/phuongmychi.jpg','2025-02-22 16:09:06','2025-04-11 16:25:32',NULL),(22,'Hạnh Thuý','1976-11-26','Ngô Phạm Hạnh Thúy, thường được biết đến với nghệ danh Hạnh Thúy (sinh ngày 26 tháng 11 năm 1976), là một nữ diễn viên, nhà biên kịch và đạo diễn sân khấu người Việt Nam.[1]','Female','public\\uploads\\1740240700321_Hanh_thuy.jpg','2025-02-22 16:11:40','2025-02-22 16:11:40',NULL);
