INSERT INTO `chat_histories` VALUES (1,1,'Hello Minh ','user','2025-04-05 07:13:27','2025-04-05 07:13:27','2025-04-09 15:06:12','2025-04-09 15:06:12'),(2,1,'Hi! Chào bạn nha! ?  Có gì mình giúp được không?  ?\n','ai','2025-04-05 07:13:29','2025-04-05 07:13:29','2025-04-09 15:06:12','2025-04-09 15:06:12'),(3,1,'hiện tại hệ thống mình có bao nhiêu phim ','user','2025-04-05 07:13:47','2025-04-05 07:13:47','2025-04-09 15:06:12','2025-04-09 15:06:12'),(4,1,'Hiện tại hệ thống mình có 6 phim đang chiếu đó bạn! ?  Bạn muốn tìm hiểu thêm về phim nào không? Hoặc bạn muốn xem phim thuộc thể loại gì nè? ?\n','ai','2025-04-05 07:13:50','2025-04-05 07:13:50','2025-04-09 15:06:12','2025-04-09 15:06:12'),(5,1,'Bây giờ tôi muốn xem phim hài đi tôi vẫn cho tôi một phim ','user','2025-04-05 07:14:10','2025-04-05 07:14:10','2025-04-09 15:06:12','2025-04-09 15:06:12'),(6,1,'Ồ, bạn muốn xem phim hài hả?  Mình thấy có hai phim hài đó bạn: \"Nhà Gia Tiên\" và \"Bộ Tứ Báo Thủ\".  Bạn có muốn mình kể thêm về nội dung của hai phim này không?  ?\n','ai','2025-04-05 07:14:12','2025-04-05 07:14:12','2025-04-09 15:06:12','2025-04-09 15:06:12'),(7,1,'nội dung nhà gia tiên đi ','user','2025-04-05 07:14:37','2025-04-05 07:14:37','2025-04-09 15:06:12','2025-04-09 15:06:12'),(8,1,'\"Nhà Gia Tiên\" kể về Mỹ Tiên, một cô gái Gen Z thích làm video triệu view,  và chuyến về nhà gặp đủ thứ chuyện dở khóc dở cười.  Về đến nhà,  Mỹ Tiên lại gặp ma anh trai mình là Gia Minh (Huỳnh Lập).  Để anh siêu thoát và không bị làm phiền nữa, Mỹ Tiên phải cùng Gia Minh giải quyết chuyện tranh chấp nhà cửa với họ hàng,  trong khi đó lại phát hiện ra nhiều bí mật động trời trong chính gia đình mình!  Liệu cuối cùng Mỹ Tiên có thành công?  Hóng phim quá đúng không nè? ?\n','ai','2025-04-05 07:14:39','2025-04-05 07:14:39','2025-04-09 15:06:12','2025-04-09 15:06:12'),(9,1,'Các rạp chiếu phim ở quận 1?','user','2025-04-09 15:06:20','2025-04-09 15:06:20','2025-04-11 20:01:22','2025-04-11 20:01:22'),(10,1,'Xin lỗi, tôi không th