INSERT INTO `directors` VALUES (17,'Thu Trang','1904-09-23','Trần Ngọc Thu Trang, thường được biết đến với nghệ danh Thu Trang (sinh ngày 23 tháng 9 năm 1984), là một nữ diễn viên kiêm nhà sản xuất phim người Việt Nam. Cô được biết đến qua các vai diễn từ các bộ phim như Em là bà nội của anh, 798Mười, Tiệc trăng máu, Gia đình là số 1 và Thập Tam Muội.[1][2]','Female','public\\uploads\\1739932492885_thu trang.jpg','2025-02-19 02:34:52','2025-02-19 02:34:52',NULL),(18,'Trấn thành','1987-02-05','Trấn Thành sinh ra và lớn lên tại Thành phố Hồ Chí Minh, có cha là người gốc Hoa đến từ Quảng Đông và mẹ là người Tiền Giang. Ngoài tiếng Việt, anh còn có thể nói tiếng Anh, tiếng Quảng Đông và Quan thoại.[1] Trấn Thành từng theo học khoa diễn viên Đại học Sân khấu - Điện ảnh.','Male','public\\uploads\\1739932684299_Tráº¥n_ThÃ nh_191226.png','2025-02-19 02:38:04','2025-02-23 08:56:50',NULL),(19,'Hoàng Nhật Nam','1975-03-12','Hoàng Hữu Nhật Nam (sinh ngày 12 tháng 3 năm 1975), thường được biết đến với nghệ danh Hoàng Nhật Nam, là một đạo diễn các show trình diễn nghệ thuật, văn hoá, giải trí người Việt Nam.','Male','public\\uploads\\1739932815365_Dao_dien_Hoang_Nhat_Nam_(3)~2.jpg','2025-02-19 02:40:15','2025-02-19 02:40:15',NULL),(20,'Huỳnh Lập','1993-05-17','Huỳnh Lập tên thật là Huỳnh Ngọc Lập, sinh ngày 17 tháng 5 năm 1993 tại thành phố Long Xuyên, tỉnh An Giang.[1]\r\n\r\nAnh có tuổi thơ sống lặng lẽ, khép kín sau khi gặp tai nạn giao thông nghiêm trọng năm 10 tuổi[3]. Anh cho biết năm đó trong một lần đi Đồng Tháp, chiếc xe chở hai cha con anh gặp tai nạn.','Male','https://res.cloudinary.com/dulanzv46/image/upload/v1744388828/directors/huynhlap.webp','2025-02-19 02:41:37','2025-04-11 16:27:14',NULL),(21,'Nguyễn Quang Dũng','1978-12-18','Nguyễn Quang Dũng sinh ngày 18 tháng 12 năm 1978 tại Thành phố Hồ Chí Minh, nguyên quán xã Mỹ Luông (nay là thị trấn Mỹ Luông), huyện Chợ Mới, tỉnh An Giang.[4] Cha anh là nhà văn Nguyễn Quang Sáng và mẹ là bà Lương Thị Phương.[5] Từ nhỏ, anh đã có nhiều cơ hội tiếp xúc với các nhân vật nổi tiếng ở nhiều lĩnh vực khác nhau như nhạc sĩ Trịnh Công Sơn, nhạc sĩ Văn Cao, nhà thơ Nguyễn Duy.[6][7] Nhạc phẩm thiếu nhi nổi tiếng \"Mẹ đi vắng\" chính là tác phẩm do nhạc sĩ Trịnh Công Sơn phổ nhạc từ lời bài hát của anh.[8][9]','Male','public\\uploads\\1739932995832_Director_Nguyen_Quang_Dung_in_2022.png','2025-02-19 02:43:15','2025-02-19 02:43:15',NULL),(22,'Julius Onah  ','1970-02-02','updating..','Male','public\\uploads\\1739947809378_dao-dien-3_20230407103506.jpg','2025-02-19 06:50:09','2025-02-19 06:50:09',NULL),(23,'Dougal Wilson ','1970-02-20','updating..','Male','public\\uploads\\1740290567378_ben-doc.jpg','2025-02-19 07:29:09','2025-02-23 06:02:47',NULL);
/*!40000 ALTER TABLE `directors` ENABLE KEYS */;
