INSERT INTO `movies` VALUES (178,'Tay Nghiệp Dư','The Amateur/ Tay Nghiệp Dư kể về Charlie Heller (Rami Malek) là một chuyên gia giải mã thiên tài nhưng sống khép kín, làm việc cho CIA. Cuộc đời anh bỗng chốc đảo lộn khi vợ anh bị sát hại trong một vụ tấn công khủng bố ở London. Khi cấp trên từ chối hành động, Charlie quyết định tự mình truy lùng những kẻ đứng sau, dấn thân vào hành trình báo thù đầy nguy hiểm trên toàn cầu, nơi trí tuệ sắc bén trở thành vũ khí tối thượng giúp anh vượt qua mọi kẻ truy đuổi. \r\nPhim mới The Amateur/ Tay Nghiệp Dư dự kiến khởi chiếu 11.04.2025 tại các rạp chiếu phim toàn quốc\r\n','https://www.youtube.com/watch?v=fYQ_1xpcWYU','https://res.cloudinary.com/dulanzv46/image/upload/v1743931915/movies/tay-nghiep-du-500_1743148894221.jpg',16,130,'2025-04-07 06:15:34','2025-04-14 11:18:21',NULL,23,'United States',2025,'2025-04-11','ended'),(179,'Địa Đạo: Mặt Trời Trong Bóng Tối','Địa Đạo: Mặt Trời Trong Bóng Tối là dự án điện ảnh kỷ niệm 50 năm hòa bình thống nhất đất nước, dự kiến khởi chiếu 30.04.2025. Phim do đạo diễn Bùi Thạc Chuyên cầm trịch, với sự tham gia của dàn diễn viên thực lực – Thái Hòa, Quang Tuấn và diễn viên trẻ Hồ Thu Anh. Vào năm 1967, chiến tranh Việt Nam ngày càng khốc liệt. Đội du kích 21 người do BẢY THEO chỉ huy tại căn cứ Bình An Đông trở thành mục tiêu mà quân đội Mỹ TÌM VÀ DIỆT số 1 khi nhận nhiệm vụ bằng mọi giá phải bảo vệ một nhóm thông tin tình báo chiến lược mới đến ẩn náu tại căn cứ. Các cuộc liên lạc vô tuyến điện từ với nhóm tình báo bị quân đội Mỹ phát hiện và định vị, lấy đi lợi thế duy nhất của đội du kích là sự vô hình trong hệ thống địa đạo rộng khắp, phức tạp và bí ẩn. Bộ phim là những câu chuyện đan xen giữa tình đồng đội, tình yêu và khát khao sống ở những người lính. Trên hết, vẫn là nghĩa vụ và sự hi sinh vì Tổ Quốc. Đạo diễn Bùi Thạc Chuyên nung nấu 10 năm trời để chuẩn bị cho phim điện ảnh Địa Đạo, đem câu chuyện huyền thoại về nhân dân miền Nam tài trí thông minh và tinh thần yêu nước ngoan cường ngày ấy lên màn ảnh rộng. Lịch sử đã chứng minh, dẫu cho trên đầu là bom rơi đạn nổ, dưới hầm là không khí đặc quánh đến hít thở cũng khó khăn, chỉ cần trong tim mỗi người chiến sĩ luôn hướng đến ánh sáng tự do của một dân tộc tự do trong tương lai, họ sẽ kiên trì đứng vững mà chiến đấu. Như có mặt trời trong bóng tối luôn soi sáng dẫn đường. \r\nPhim mới Địa Đạo: Mặt Trời Trong Bóng Tối suất chiếu sớm 2-3.4.2025 (Không áp dụng Movie Voucher), dự kiến ra mắt tại các rạp chiếu phim toàn quốc từ 04.04.2025.\r\n\r\n','https://youtu.be/ZjWI5zinZzI','https://res.cloudinary.com/dulanzv46/image/upload/v1743788825/movies/dia-dao-bong-toi.jpg',16,128,'2025-04-07 06:17:51','2025-04-15 11:58:32',NULL,21,'Vietnam',2025,'2025-04-02','ended'),(180,'Bộ Ba Thành Belleville','The Triplets Of Belleville là bộ phim hoạt hình xuất sắc nhận 2 đề cử Oscar. Cháu trai của bà Souza bị bắt cóc lúc tham gia cuộc đua xe đạp Tour de France. Bà cùng chú chó thân yêu Bruno kết hợp cùng hội chị em Belleville – một nhóm nhảy của các quý bà trung niên cố gắng giải cứu cậu. The Triplets Of Belleville/ \r\nBộ Ba Thành Belleville trình chiếu vào 12.04.2025\r\n\r\n','https://youtu.be/PZeWp1D8MlU','https://res.cloudinary.com/dulanzv46/image/upload/v1744432521/movies/B%C3%A1%C2%BB%C2%99%20Ba%20Th%C3%83%C2%A0nh%20Belleville.jpg',0,80,'2025-04-12 04:35:22','2025-04-19 01:15:33',NULL,23,'France',2025,'2025-04-12','ended'),(181,'Cưới Ma Giải Hạn','Phim mới The Red Envelope\r\nCưới Ma Giải Hạn kể về gã trai thẳng chính hiệu Menn tình cờ nhặt được bao lì xì đỏ và bị bắt phải kết hôn với hồn ma. Menn là tên trộm cắp đang làm tay trong cho cảnh sát, đồng thời cũng là một gã trai thẳng chính hiệu. Ngày nọ, Menn vô tình nhặt được một bao lì xì đỏ bí ẩn và bị ràng buộc bởi khế ước siêu nhiên, bắt anh phải kết hôn với một hồn ma. Không dừng lại ở đó, số phận càng trớ trêu hơn khi “vợ” của Menn không chỉ là người cõi âm, mà còn là một “mỹ” vong dễ thương với tư tưởng cấp tiến tên Titi. Menn buộc phải giúp Titi tìm ra sự thật đằng sau vụ tai nạn cướp đi sinh mạng của cậu để Titi được siêu thoát và trả lại bình yên cho mình. Trùng hợp làm sao, tất cả đầu mối đều dẫn đến vụ buôn ma túy bất hợp pháp do Menn và Goi, nữ cảnh sát lớn tuổi mà Menn yêu mến, đang điều tra. Tin rằng việc phá án sẽ có lợi cho sự nghiệp và tình yêu của mình, Menn quyết định tham gia phi vụ bất bình thường này để giúp Titi, từ đó tạo nên một mối liên kết không tưởng giữa đồng tính và trai thẳng, giữa người sống và kẻ chết. \r\nPhim mới The Red Envelope/ Cưới Ma Giải Hạn dự kiến khởi chiếu 11.04.2025 tại các rạp chiếu phim toàn quốc.\r\n','https://youtu.be/CkVv1hHJl-M','https://res.cloudinary.com/dulanzv46/image/upload/v1744432667/movies/C%C3%86%C2%B0%C3%A1%C2%BB%C2%9Bi%20Ma%20Gi%C3%A1%C2%BA%C2%A3i%20H%C3%A1%C2%BA%C2%A1n.jpg',18,128,'2025-04-12 04:37:48','2025-04-19 01:15:33',NULL,23,'Thailand',2025,'2025-04-12','ended'),(182,'Mẹ Quỷ Con Ma','Anak Kunti/ Mẹ Quỷ Con Ma kể về việc bị ám ảnh bởi những lời kêu gọi từ bóng tối, Sarah một nữ sinh Trong trường Đạo quyết tâm trở về quê nhà để làm rõ thân phận của mình. Bước chân về làng, nơi giờ đây trở thành địa điểm để phá thai trái phép, Sarah phải đối mặt với sự xa lánh bởi những kẻ không có đức tin. Cô cũng không biết chính sự có mặt của mình đã làm thức tỉnh oan hồn của mẹ cô - người đã bị giết chết trong lúc cố sinh ra cô. Cả ngôi làng giờ đây phải lãnh nghiệp báo mà họ đã gây ra nhiều năm về trước. \r\nPhim mới Anak Kunti/ Mẹ Quỷ Con Ma dự kiến khởi chiếu 18.04.2025 tại các rạp chiếu phim toàn quốc.\r\n\r\n','https://youtu.be/baPNIFuGB_c','https://res.cloudinary.com/dulanzv46/image/upload/v1744434257/movies/M%C3%A1%C2%BA%C2%B9%20Qu%C3%A1%C2%BB%C2%B7%20Con%20Ma.jpg',18,97,'2025-04-12 05:04:17','2025-04-23 08:52:11',NULL,23,'Indonesia',2025,'2025-04-18','now_showing'),(183,'Đầu Xuôi Đuôi Đút Lót','Lobby/ Đầu Xuôi Đuôi Đút Lót kể về Yoon Chang Wook - CEO một công ty công nghệ nhỏ, giỏi nghiên cứu nhưng mù tịt chuyện thương trường. Khi công ty sắp sập tiệm vì bị “bạn thân” cũ Son Gwang-woo đâm sau lưng bằng chiêu trò đút lót để giành lấy dự án quốc gia, Chang-wook buộc phải bước vào một cuộc chơi hoàn toàn xa lạ: đút lót bằng golf - “môn thể thao quyền lực” của giới làm ăn. Một trận đấu thầu có một không hai, nơi những cú đánh trượt là chiến lược, còn đút lót là kỹ năng, tạo nên trận đấu vừa hài hước, vừa châm biếm về thương trường thời hiện đại. Lobby/ \r\nĐầu Xuôi Đuôi Đút Lót dự kiến khởi chiếu 18.04.2025 tại các rạp chiếu phim toàn quốc.\r\n\r\n','https://youtu.be/npe-ubPIjKA','https://res.cloudinary.com/dulanzv46/image/upload/v1744630213/movies/%C3%84%C2%90%C3%A1%C2%BA%C2%A7u%20Xu%C3%83%C2%B4i%20%C3%84%C2%90u%C3%83%C2%B4i%20%C3%84%C2%90%C3%83%C2%BAt%20L%C3%83%C2%B3t.jpg',0,128,'2025-04-14 11:30:15','2025-04-23 08:51:29',NULL,23,'South Korea',2025,'2025-04-20','ended');
