INSERT INTO `producers` VALUES (8,'Trấn thành Town','Trấn Thành Town là một công ty trách nhiệm hữu hạn do Huỳnh Trấn Thành sáng lập và bắt đầu hoạt động từ ngày 7 tháng 5 năm 2020 có trụ sở tại quận 12, Thành phố Hồ Chí Minh. Công ty hiện đang hoạt động chính về mảng sản xuất phim điện ảnh, phim video và các chương trình truyền hình.','public\\uploads\\1739945285182_avatar1708567566833-17085675676721471219113.webp','2025-02-19 06:08:05','2025-04-11 16:00:15',NULL),(9,'Galaxy Studio','Chiếm thị phần hàng đầu về hoạt động phát hành phim, đồng sản xuất phim và chiếu phim rạp, việc sở hữu 20 cụm rạp trên toàn quốc là thành quả của Galaxy Studio sau 20 năm không ngừng chuyển mình.\r\nHai thập kỷ đồng hành cùng nghệ thuật thứ 7\r\nNhững năm 1990, khi đất nước bước vào thời kỳ đổi mới, các tác phẩm điện ảnh phản ánh hiện thực cuộc sống xuất hiện và tạo nên bức tranh nghệ thuật thứ 7 đa sắc. Song, chỉ sau vài năm, khán giả dần quay lưng với điện ảnh Việt do chất lượng đi xuống của hàng loạt bộ phim \"mì ăn liền\".\r\n\r\nTrước cuộc khủng hoảng chưa từng có, từ năm 2003, Việt Nam quyết định mở cửa ngành công nghiệp điện ảnh, cho phép doanh nghiệp tư nhân đầu tư. Galaxy Studio trở thành đơn vị tiên phong, đặt nền móng cho việc khôi phục và đưa điện ảnh Việt Nam vươn tầm quốc tế.\r\n\r\nSau thành công với doanh thu kỷ lục từ phim Gái nhảy của đạo diễn Lê Hoàng, Galaxy Studio nhanh chóng tiếp nối hướng đi đầy tiềm năng ấy tại thị trường điện ảnh Việt, qua đó chi 1,6 tỉ đồng cho \"phát súng đầu tiên\" mang tên Những cô gái chân dài.','public\\uploads\\1739945466192_images.png','2025-02-19 06:11:06','2025-02-19 06:11:06',NULL),(10,'Challenge Me Studios  Xem thêm tại: https://www.galaxycine.vn/dat-ve/den-am-hon/','Loading','public\\uploads\\1739945655039_unnamed.jpg','2025-02-19 06:14:15','2025-02-19 06:22:58','2025-02-19 06:22:58'),(11,'Thu trang Entertainment','Chúng tôi là CÔNG TY TRÁCH NHIỆM HỮU HẠN GIẢI TRÍ TỔNG HỢP THU TRANG. Lời đầu tiên, chúng tôi xin gửi lời chào nồng nhiệt và thân thương đến tất cả khách hàng và các đối tác kinh doanh, đã tin tưởng, hỗ trợ và hợp tác cùng chúng tôi trong những sản phẩm giải trí suốt những năm qua.\r\n\r\nTừ năm 2016, công ty chúng tôi đã sáng tạo ra nhiều sản phầm, như phim chiếu mạng (Web Drama), những video clip hài, phim điện ảnh…., và nhận được rất nhiều tình yêu thương cũng như những lời động viên, khen ngợi từ phía khán giả và giới truyền thông.\r\n\r\nVới một đội ngũ tài năng, nhiệt huyết, chúng tôi không ngừng cố gắng để trở thành một thương hiệu uy tín, thể hiện qua những sản phẩm của mình, đặc biệt phim chiếu mạng “Thập Tam Muội” và phim điện ảnh “Chị 13” đã nhận được sự đón nhận nồng nhiệt.\r\n\r\nChúng tôi cam kết nỗ lực quản lý, phát triển liên tục, để đứng đầu thị trường và đáp ứng được kỳ vọng của khán giả qua những sản phẩm của mình.\r\n\r\nChúng tôi hy vọng tiếp tục hợp tác với những đối tác và khách hàng của chúng tôi trong những dự án quan trọng sắp tới, cơ hội đầu tư và trải nghiệm giải trí chất lượng cao.\r\n\r\nGiám Đốc – Nữ diễn viên Thu Trang”','public\\uploads\\1739945944857_logo.png','2025-02-19 06:19:04','2025-02-19 06:19:04',NULL),(12,'17 Production','17 Production là công ty của Huỳnh Lập – Hồng Tú với thế mạnh là sản xuất viral clip, MV, sitcom, các chương trình hài. Ra đời chưa lâu nhưng công ty đã có nhiều sản phẩm thu hút.','public\\uploads\\1739946077757_images (1).png','2025-02-19 06:21:17','2025-02-19 06:21:17',NULL),(13,'Hk phim','Sau một thời gian làm quay phim cho các video âm nhạc, Trinh Hoan cùng với vợ ông Nguyễn Nữ Như Khuê tham gia đồng sáng lập công ty sản xuất phim HK Film.','public\\uploads\\1739946142059_HKfilm-Logo.jpg','2025-02-19 06:22:22','2025-02-19 06:22:22',NULL),(14,'Challenge Me Studios  ','ĐÈN ÂM HỒN của đạo diễn Hoàng Nam Challange Me chính thức bán vé từ hôm nay! Bộ phim tâm linh gia đình đầy ám ảnh lấy cảm hứng từ Chuyện Người Con Gái Nam Xương, hứa hẹn mang đến những giây phút giải trí và cảm xúc sau đợt nghỉ Tết dài. Đặt vé ngay và cùng gia đình khám phá bí ẩn đằng sau ánh đèn ma mị nhé!','public\\uploads\\1739946214184_unnamed.jpg','2025-02-19 06:23:34','2025-02-22 09:55:40','2025-02-22 09:55:40'),(15,'Marval studio','Công ty con của tập đoàn Disney. Vào ngày 31 tháng 12 năm 2009, Công ty Walt Disney mua Marvel Entertainment với giá 4 tỷ đô la.','public\\uploads\\1739946287118_1-1679471489495335279082-1679477649506-1679477649902887671807.webp','2025-02-19 06:24:47','2025-02-19 06:24:47',NULL),(18,'20th Century Studios',NULL,'https://res.cloudinary.com/dulanzv46/image/upload/v1743931403/producers/20th%20Century%20Studios.jpg','2025-04-06 09:23:24','2025-04-06 09:23:24',NULL),(20,'Film Momentum',NULL,'https://res.cloudinary.com/dulanzv46/image/upload/v1744630031/producers/Film%20Momentum.jpg','2025-04-14 11:27:13','2025-04-14 11:27:13',NULL);
/*!40000 ALTER TABLE `producers` ENABLE KEYS */;
