INSERT INTO `promotions` VALUES (1,'Khuyến Mãi Giải Phóng Miền Nam, Quốc Tế Lao Động 30/4 - 1/5','Khuyến Mãi Giải Phóng Miền Nam, Quốc Tế Lao Động 30/4 - 1/5 ?\n\nChào mừng ngày lễ lớn 30/4 - 1/5, chúng tôi mang đến chương trình ưu đãi đặc biệt dành cho khách hàng:\n✅ Giảm giá hấp dẫn cho vé xem phim, thức ăn & tổng hóa đơn\n✅ Áp dụng từ 27/04 - 02/05\n✅ Số lượng có hạn, nhanh tay sử dụng ngay!\n\n? Lưu ý: Mã giảm giá chỉ áp dụng cho đơn hàng từ 200.000đ trở lên.\n\nNhập mã giảm giá khi thanh toán online để nhận ưu đãi! ?','2025-04-27 00:00:00','2026-05-02 00:00:00','percentage',10,'total_bill','BILL-OJSBDP',200000,20000,20,2,'2025-03-28 14:52:17','2025-03-28 14:52:17',NULL),(2,'Khuyến Mãi Nhân Dịp Khai Trương','? Khuyến Mãi Mừng Khai Trương Từ 10/4 - 16/4 ?\n\nNhân dịp khai trương, chúng tôi mang đến chương trình ưu đãi đặc biệt dành cho khách hàng:\n\n✅ Tặng voucher 50.000đ cho đơn hàng từ 500.000đ trở lên.\n\n⏳ Thời gian áp dụng: Từ 10/4 đến 16/4\n? Áp dụng tại: Tất cả các chi nhánh và mua hàng online\n\nNhanh tay đặt hàng để không bỏ lỡ cơ hội có 1-0-2 này nhé! ??','2025-04-10 00:00:00','2025-04-16 00:00:00','fixed_amount',50000,'total_bill','BILL-NI7QOG',300000,NULL,50,1,'2025-03-28 15:34:36','2025-03-28 15:34:36',NULL);
